class p242_Valid_anagram {
    public boolean isAnagram(String s, String t) {
        HashMap<Character, Integer> hm = new HashMap<>();
        HashMap<Character, Integer> hm2 = new HashMap<>();

        if (s.length() != t.length()){
            System.out.println("the length is not the same");
            return false;
        }

        for (long i = 0; i < s.length(); i++){
            char c = s.charAt((int)i);
            hm.put(c, hm.getOrDefault(c, 0) + 1);
        }

        for (long i = 0; i< t.length(); i++){
            char c = t.charAt((int) i);
            hm2.put(c, hm2.getOrDefault(c, 0) + 1);
        }

        // if (hm.size() != hm2.size()){
        //     System.out.println("The length of the maps are not the same");
        //     return false;
        // }

        // for (char c: hm.keySet()){
        //     if(hm.get(c) != hm2.get(c)){
        //         System.out.println("The count of character for ["+ c + "] is not matching [" + hm.getOrDefault(c, -1) + "|" + hm2.getOrDefault(c, -1) + "]");
        //         return false;
        //     }
        // }
        return hm.equals(hm2);
    }

    public static void main(String[] args){
        p242_Valid_anagram s = new p242_Valid_anagram();
        // String s1 = "";

        // String s2 = "";
        
        String s1 = "anagram";
        String s2 = "nagaram";
        System.out.println(s.isAnagram(s1, s2));
    }
}